import React from 'react';
import Header from './Header';
import AboutMe from './AboutMe';
import Projects from './Projects';
import Timeline from './Timeline';

const Home = () => {
    return (
        <React.Fragment>
            <Header/>
            <AboutMe/>
            <Timeline/>
            <Projects/>
       </React.Fragment>
    );
};

export default Home;
